snippet.description:
Ich wurde zu Minecraft Helden 2 eingeladen! In diesem Projekt machen viele weitere YouTuber mit - doch ich habe eine Limitierung. Ich habe mir vorgenommen: Solange es keine Situation erzwingt darf ich niemanden durch meine Hand besiegen. Doch in dem heutigen Video hat mir tatsächlich jemand bereits etwas angetan, weswegen es sein kann, dass ich als Pazifist nicht lange durchhalten werde. Um herauszufinden was passiert ist schaut das Video unbedingt bis zum Ende!

Das Ganze ist Minecraft Helden 2, nicht MysticSMP, Craft Attack 12, der YouTuber Insel oder dem DreamSMP. Die Art der Darstellung inspiriert sich von Parrot, aka. ParrotX2 und der Serie vom Lifesteal SMP und dem Unstable Universe. 

